import React, { Children } from "react";
import PropTypes from 'prop-types';

const Button = ({type, children}:any) => {
    return (
        <button type={type}>{children}</button>
    )
}

Button.propTypes = {
    Children: PropTypes.any.isRequired
}

export default Button;
